// Complete the reverseShuffleMerge function below.
func reverseShuffleMerge(s string) string {
	tmp := make(map[string]int)
	count := make(map[string]int)
	ret := ""
	idx := len(s)
	for i := range s {
		count[string(s[i])]++
	}
	for i := range count {
		count[i] /= 2
	}
	for i := len(s) - 1; i >= 0; i-- {
		char := string(s[i])
		tmp[char]++
		if tmp[char] <= count[char] || count[char] == 0 {
			continue
		}
		min := char
		//fmt.Println(">>", char, i, idx, tmp[char] , count[char])
		//fmt.Println(count)
		tt := ""
		t1 := 0
		for j := i + 1; j < idx; j++ {
			ch := string(s[j])

			if ch == char {
				t1++
				continue
			}
			if len(ret) < 562 && len(ret) > 546 {
				fmt.Println("-->", ch, min, t1, j, i)
			}
			if ch <= min && count[ch] > 0 {
				min = ch
				tt = min + tt
				count[ch]--
				tmp[min] -= 2
			}
		}
		idx = i + t1
		if count[char] > 0 {
			tt = tt + char
			count[char]--
		}
		ret = ret + tt
		tmp[char] -= 2
		if len(ret) < 562 && len(ret) > 547 {
			fmt.Println(tt, char, tmp[char], count[char], i)
		}
	}
	//rr :=""
	//for i := 0; i < len(ret); i++ {
	//	if ret[i] != rr[i] {
	//		fmt.Println("::", i)
	//	}
	//}
	//fmt.Println(ret)
	return ret
}
